import React from 'react';



const UserItem = (props) => {


    return(
        <li className={'user-item'}>
            <div className={'user-item__content'}>
                <div className={'user-iterm__image'}>
                    <img src={props.image} alt={props.name}/>
                </div>
            </div>
        </li>
    );
}

export default UserItem
